import React from "react";
import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css';

//import React pages
import Sidebar from "./components/SideBar";
import Post from "./components/Post";

function App() {
  return (
    <container>
      <row>
        <col>
          <Sidebar />
        </col>

        <col>
          <Post />
          <Post />
          <Post />
        </col>
      </row>
    </container>
  );
}

export default App;
